        private static void HardcodearPasajeros()
        {
            bool esPremium = false;
            Equipaje equipaje;

            for (int i = 0; i < 700; i++)
            {
                int nroRandom = new Random().Next(0, 100);
                if (nroRandom % 2 == 0)
                {
                    esPremium = false;
                    equipaje = new Equipaje(false, new Random().Next(0, 25));
                }
                else
                {
                    esPremium = true;
                    equipaje = new Equipaje(false, new Random().Next(0, 50));
                }

                listaModeloPasajeros.Add(new Pasajero(listaClientes.ElementAt(i), listaModeloPasaportes.ElementAt(i), esPremium, equipaje));
            }
        }

